const Nav = () => {
  const {
    page,
    setPage
  } = useContext(pocketContext);

  return(
  <div className="flex-row s-btw">
    <ButtonIcon iconSvg={ svgs.calendar } callback={ () => {} } page="calendar"/>
    <ButtonIcon iconSvg={ svgs.taskList } callback={ () => {} } page="tasks"/>
    <ButtonIcon iconSvg={ svgs.money } callback={ () => {} } page="finance"/>
    <ButtonIcon iconSvg={ svgs.email } callback={ () => {} } page="email"/>
  </div>)
};

Nav.propTypes = {};

Nav.defaultProps = {};

export default Nav;
